import { React } from "react";

/* import "./styles/Movies.css" */

const Favorites = ({ props }) => {
  return (
    <div class="card pad">
      <div>
        <figure>
          <img src={props.img} alt={props.name} />
          <p>{props.name}</p>
        </figure>
      </div>
    </div>
  );
};

export default Favorites;
